(window.webpackJsonp=window.webpackJsonp||[]).push([[44],{334:function(e,n,s){"use strict";s.r(n),n.default='<h2 id="experiments"><code>experiments</code><a href="#experiments" aria-hidden="true"><span class="icon icon-link"></span></a></h2>\n<p><code>boolean: false</code></p>\n<p><code>experiments</code> option was introduced in webpack 5 to empower users with the ability to activate and try out experimental features.</p>\n<blockquote class="warning">\n<p>Because experimental features have relaxed semantic versioning and might contain breaking changes, make sure to fix webpack\'s version to minor e.g. <code>webpack: ~5.4.3</code> instead of <code>webpack: ^5.4.3</code> or use a lockfile when using <code>experiments</code>.</p>\n</blockquote>\n<p>Available options:</p>\n<ul>\n<li><code>mjs</code>: Support <code>.mjs</code> files as a way to define <a href="https://nodejs.org/api/esm.html#esm_ecmascript_modules">EcmaScript modules</a></li>\n<li><code>syncWebAssembly</code>: Support the old WebAssembly like in webpack 4</li>\n<li><code>asyncWebAssembly</code>: Support the new WebAssembly according to the <a href="https://github.com/WebAssembly/esm-integration">updated specification</a>, it makes a WebAssembly module an async module</li>\n<li><code>topLevelAwait</code>: Support the <a href="https://github.com/tc39/proposal-top-level-await">Top Level Await Stage 3 proposal</a>, it makes the module an async module when <code>await</code> is used on the top-level</li>\n<li><code>importAsync</code>: import async modules with <code>import</code></li>\n<li><code>importAwait</code>: import async modules with <code>import await</code></li>\n<li><code>asset</code>: a type of module that allows to use asset files (fonts, images, etc) without configuring loaders to handle their importing, similar to <code>file-loader</code> | <code>url-loader</code> | <code>raw-loader</code></li>\n<li><code>outputModule</code>: enables the use of <a href="/configuration/output/#outputmodule"><code>output.module</code></a> configuration option and sets it to <code>true</code>. Enables the use of <code>output.libraryTarget</code> as <code>\'module\'</code> and sets it to <code>\'module\'</code>.</li>\n</ul>\n<p><strong>webpack.config.js</strong></p>\n<pre><code class="hljs language-javascript">module<span class="token punctuation">.</span>exports <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token comment">//...</span>\n  experiments<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    mjs<span class="token punctuation">:</span> <span class="token boolean">true</span><span class="token punctuation">,</span>\n    outputModule<span class="token punctuation">:</span> <span class="token boolean">true</span><span class="token punctuation">,</span>\n    syncWebAssembly<span class="token punctuation">:</span> <span class="token boolean">true</span><span class="token punctuation">,</span>\n    topLevelAwait<span class="token punctuation">:</span> <span class="token boolean">true</span><span class="token punctuation">,</span>\n    asset<span class="token punctuation">:</span> <span class="token boolean">true</span><span class="token punctuation">,</span>\n    asyncWebAssembly<span class="token punctuation">:</span> <span class="token boolean">true</span><span class="token punctuation">,</span>\n    importAsync<span class="token punctuation">:</span> <span class="token boolean">true</span><span class="token punctuation">,</span>\n    importAwait<span class="token punctuation">:</span> <span class="token boolean">true</span><span class="token punctuation">,</span>\n  <span class="token punctuation">}</span><span class="token punctuation">,</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n'}}]);